import React from "react";

import ImportExternalJs from '../customHooks/ImportExternalJs';


const Demo = props => {
  ImportExternalJs("https://raw.githubusercontent.com/Tapadyuti/React_002/main/src/component/Counter.js");
}


function GreetFunctionalNormalComponent (){
    return (
        <div>
            <h5>THis is Functional Component with ES5 function.</h5>
        </div>
    )
}

export default GreetFunctionalNormalComponent(ImportExternalJs);
